import Navbar from "../Global/Navbar/Navbar";
import { Fragment } from "react";
const ContactPage = () => {
  return (
    <div>
       <Fragment>
       <Navbar />
      <h1>Contact Page</h1>
      <p>Phone: 123-456-7890</p>
      <p>Email: yak.king</p>
      </Fragment>
    </div>
  );
};

export default ContactPage;
